import React from 'react';


export default class Home extends React.Component{
    render() {
        return(
            <div>
            <h2> Welcome!</h2>
            <p>I created my small page with simple examples<br/> for demonstration of the passed materials.</p>

            <p>Not all examples are laid out here, but I continue developing</p>
            </div>
            
        );
    }
}
